Back home in the Bronx!! Thank you to all the incredible Latina entrepreneurs for sharing your stories and letting me share mine with you yesterday! You inspired me more than you will ever know. Remember, we’re not asking for a seat at the table … we’re the CEOs at the table! 

Thank you David Solomon and your Goldman Sachs team for bringing together this powerhouse group and creating the 10,000 Small Business Program so these Founders can get the access and resources they deserve. This is just the start of #LimitlessLabs and I can’t wait for what’s to come! ✨

